import MyButton from '../../components/UI/MyButton/MyButton';
import classes from './Profile.module.css';

function Profile() {
    return (
        <div >
            <div className={classes.greetings}>
                привет пользователь
            </div>

            <div className={classes.history}>

                <div className={classes.text}>
                    историязаказов
                </div>

                <MyButton>
                    показать
                </MyButton>
                
            </div>
        
        </div>
        
    );
}

export default Profile;
